INSERT INTO `Is_competition` VALUES (5, '2020-05-04 15:18:23', NULL, 'annex', '![logo.png](http://127.0.0.1:9000/img/8f0d66977f21489ab51448ea3a8053cc-logo.png)\n# 关于举办桂林航天工业学院2020年网页设计大赛的通知\n\n 各院系：\n为了学习宣传贯彻党的十九大精神，促进我校大学生计算机应用水平的提高，培养学生的实践能力、创新意识和团队精神，决定举办2018年网页设计大赛。现将有关事项通知如下： \n######  一、 组织机构 \n本次大赛由学校党委宣传部、教务处和计算机科学与工程学院联合主办。 \n###### 二、竞赛主题 \n本次大赛以《五四青年》为主题。 \n###### 三、参赛要求 \n###### 1、参赛对象\n本次大赛面向在校所有学生，可以以个人或小组形式参赛。每件作品的作者不得超过5人。\n###### 2、作品要求\n主题鲜明突出，文字简洁通顺，真情实感，言之有物；网站栏目结构清晰，能充分表达主题，运行正确，风格协调，界面设计美观有创意，浏览方便。可根据选题的内容提出一个副标题。\n已经在其他省级以上比赛中获奖的作品不能再参加本次大赛。 \n##### 3、截止时间 \n所有参赛作品请于2018年5月10日之前提交，过期不候。\n###### 五、奖项设置 \n本次大赛共设奖20个（视参赛作品数量可作适当调整），其中，一等奖2个，二等奖3个，三等奖5个，优秀奖10个。所有奖项均颁发荣誉证书和奖品，并择优推荐作为学校相关宣传专题主页用。\n\n联系人：      联系电话：   QQ：\n邮  箱：@guat.edu.cn\n\n\n计算机科学与工程学院\n\n', '2020-06-04 00:00:00', NULL, '校级', '第一届网页设计大赛', '1', 'f63757184288402c91fe6adea956dc9a-关于举办我校网页设计大赛的通知（请宣传）.docx', '计算机科学与工程学院', '飞天楼210', '李老师-计算机科学与工程学院', '2020-06-03 00:00:00', '公开', b'0', 'offline', NULL, '2020-05-23 20:00:00');
